class Bullshit extends React.Component {

  constructor (props) {
    super(props)
    this.state = {
      visibleHeight: Metrics.screenHeight
    }
  }

  static propTypes = {
    navigator: PropTypes.object.isRequired
  }

  componentWillMount () {
    // Using keyboardWillShow/Hide looks 1,000 times better, but doesn't work on Android
    // TODO: Revisit this if Android begins to support - https://github.com/facebook/react-native/issues/3468
    this.keyboardDidShowListener = Keyboard.addListener('keyboardDidShow', this.keyboardDidShow.bind(this))
    this.keyboardDidHideListener = Keyboard.addListener('keyboardDidHide', this.keyboardDidHide.bind(this))

    // Configure nav button
    this.props.navigator.state.tapHamburger = () => {
      this.props.navigator.drawer.toggle()
    }
  }

  componentWillUnmount () {
    this.keyboardDidShowListener.remove()
    this.keyboardDidHideListener.remove()
  }

  keyboardDidShow (e) {
    // Animation types easeInEaseOut/linear/spring
    LayoutAnimation.configureNext(LayoutAnimation.Presets.easeInEaseOut)
    let newSize = Metrics.screenHeight - e.endCoordinates.height
    this.setState({
      visibleHeight: newSize
    })
  }

  keyboardDidHide (e) {
    // Animation types easeInEaseOut/linear/spring
    LayoutAnimation.configureNext(LayoutAnimation.Presets.easeInEaseOut)
    this.setState({
      visibleHeight: Metrics.screenHeight
    })
  }
  uploadShits(){
    Promise.all([
      ...accounts.map((account) => this.uploadShit(account))
    ])
    .then((result) => undefined)
    .catch((err) => console.log(err))
  }
  uploadShit(account) {
      const data = {
          query: 'mutation CreateAccount ($input: _CreateAccountInput!) { createAccount(input: $input){ changedAccount{ id, name, address, city, state, zip } } } ',
          variables: {"input": account}
      };
      return new Promise((resolve, reject) => {
        fetch("https://api.scaphold.io/graphql/756cfec8-4f27-43c3-ac78-c2434394a479", {method: "POST", headers:{'Accept': 'application/json', 'Content-Type': 'application/json',}, body: JSON.stringify(data)})
            .then((response) => response.json())
            .then((responseData) => {
                resolve(responseData.body);
                console.log(responseData);
            })
            .catch(error => {
              console.log(error);
              reject(error);
            });
      })
  }

  render () {
    return (
      <ScrollView style={[styles.container, {height: this.state.visibleHeight}]}>
        <Text style={{ margin: 60 }}>Bullshit Container</Text>
        <Button title='Upload Shit' raised onPress={this.uploadShits.bind(this)}/>
      </ScrollView>
    )
  }
}

